import Vue from 'vue';
import Router from 'vue-router';
import Home from "./views/Home.vue";
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    name: 'home',
    component: Home
  }, {
    path: '/detail',
    name: 'detail',
    component: function component() {
      return import("./views/Detail.vue");
    }
  }, {
    path: '/submit',
    name: 'submit',
    component: function component() {
      return import("./views/Submit.vue");
    }
  }]
});
